export enum PieceColor { 
    BLACK = 'b', 
    WHITE = 'w'
}

export enum PieceType {
    PAWN = 'p', 
    KING = 'k', 
    QUEEN = 'q', 
    ROOK = 'r', 
    KNIGHT = 'n',
    BISHOP = 'b'
}

export interface PieceObject {
    color: PieceColor,
    type: PieceType
}
